import {Route,Switch,Redirect} from 'react-router-dom';
import AllQuotes from './Pages/AllQuotes';
import QuoteDetails from './Pages/QuoteDetails';

function App() {
  return (
    <Switch>
      <Route path="/" exact>
        <Redirect to="/quotes"/>
      </Route>
      <Route path="/quotes" exact>
        <AllQuotes/>
      </Route>
      <Route path="/quotes/:quoteId">
        <QuoteDetails/>
      </Route>
    </Switch>
  );
}

export default App;
